import './ExpenseItem.css';
function ExpenseItem() {
  return (
    <div class>
      <div>July 14 2021</div>
      <div>
        <h2>Car Insurance</h2>
      </div>
      <div>Rs 8000</div>
    </div>
  );
}
export default ExpenseItem;
